type Props = {
  className?: string;
  onClick?: () => void;
};

const OAuthSignInButtonWrapper = ({ children, className, onClick }: PropsWithChildren<Props>) => {
  return (
    <button
      className={twMerge(
        clsx('h-12 rounded-lg flex items-center justify-center dangol-typo-element3', className),
      )}
      type="button"
      onClick={onClick}
    >
      {children}
    </button>
  );
};

